import React from 'react';
import {connect} from "react-redux";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Navbar,Nav,NavItem} from "react-bootstrap";


const NavBarButtons = () => {
    return (
        <div>
            <Navbar>
                <Navbar.Brand>
                    <a href="#">pp</a>
                </Navbar.Brand>
                <Navbar.Toggle />
                <Navbar.Collapse>
                    <Nav pullRight> </Nav>
                </Navbar.Collapse>
            </Navbar>


        </div>
    );
};

export default connect()(NavBarButtons) ;
